      s.letterSpacing = this.p +"px";
      s.borderColor = this.colors;
      s.resize = this.resize?"both":"none"
      this.ss = structuredClone(s);
    }

    render(){
      return (
        <div id={id} style={
          {
            width:this.__width,
            height:this.__height
          }
        } onClick={()=>this.emit("click")} onPointerMove={()=>this.emit("mouse")}>
          <video hidden={!(this.o == "v")} controls  onEnded={()=>this.emit("end")} onVolumeChange={()=>this.emit("vol")}  onPlay={()=>this.emit("play")} onPause={()=>this.emit("pause")} style={this.ss} muted={this.mute} src={
            this.o == "v"?this.src:""
          } crossOrigin={this.c ?"use-credentials":"anonymous"} autoPlay={this.caa} onError={()=>this.emit("err")}></video>
          <textarea hidden={!(this.o == "t")} style={this.ss}>{this.value}</textarea>
