            this.o == "im"?this.src:""
          } crossOrigin={this.c ?"use-credentials":"anonymous"} onError={()=>this.emit("err")}></img>
          <input hidden={!(this.o == "in")} style={this.ss} value={this.value}></input>
          <span hidden={!(this.o == "s")} style={this.ss}>{this.value}</span>
        </div>
      )
    }

    blur(sec){
     document.getElementById(id)?document.getElementById(id).animate([{
      filter:"blur(5px)"
     },{
       filter:"none"
     }],{
      duration:sec*1000,
      fill:this.mode,
      iterations:this.iter,
      easing:this.d
     }):0
    }

    rotate(ro,sec){
      document.getElementById(id)?
      (()=>{
        document.getElementById(id).animate([{
        transform:`none`
       },{
         transform:`rotate(${ro}deg)`
       }],{
        duration:sec*1000,
        fill:this.mode,
        iterations:this.iter,
        easing:this.d
       });
      })():0;    
    }

    scale(ro1,ro2,sec){
      document.getElementById(id)?
      (()=>{
        document.getElementById(id).animate([{
        transform:`scale(${ro1})`
       },{
         transform:`scale(${ro2})`
       }],{
        duration:sec*1000,
        fill:this.mode,
        iterations:this.iter,
        easing:this.d
       });
      })():0;    
    }

    custom(a,b,c,d){
      document.getElementById(id)?
      (()=>{
        document.getElementById(id).animate([{
        [a]:b
       },{
         [a]:c
       }],{
        duration:d*1000,
        fill:this.mode,
        iterations:this.iter,
        easing:this.d
       });
      })():0;   
    }

    play(){
      document.getElementById(id).querySelector("video").play()
    }

    pause(){
      document.getElementById(id).querySelector("video").pause()
    }
  }

  
