      content: content,
      duration: duration,
      icon: icon === 'none' ? '' : icon,
      maskClickable: maskClickable === 'true' ? true : false,
      position: position,
      afterClose: () => { this.afterClose(arguments[0]/*label*/) },
    });
    if (sleep === 'wait1') { await this.sleep(duration) }
    else if (sleep === 'wait2') {
      await new Promise((resolve => this.bus.once('afterClose' + label, resolve)));
    }
  };

  clear = () => {
    Antd.Toast.clear();
  };


  afterClose = (label) => {
    this.bus.emit('afterClose' + label)
    this.emit('afterClose', label);
  };

}

