class Widget extends InvisibleWidget {
    constructor(props){
        super(props)
        this.id = null
        this.records = []
    }
    startRecord(ms, timeout, enableHighAccuracy){
        this.id = navigator.geolocation.watchPosition((e)=>{this.successCallback(e)}, (e)=>{this.errorCallback(e)}, {
            timeout: timeout,
            enableHighAccuracy: enableHighAccuracy,
            maximumAge: ms
        })
    }
    successCallback(pos){
        //console.log(pos)
        this.records.push({
            ...(pos.coords.toJSON()),
            timestamp: pos.timestamp
        })
        this.emit('receiveNew',
            pos.timestamp,
            pos.coords.latitude,
            pos.coords.longitude,
            pos.coords.accuracy,
            pos.coords.altitude,
            pos.coords.altitudeAccuracy,
            pos.coords.heading,
            pos.coords.speed
        )
    }
    errorCallback(err){
        this.emit('receiveError', {
            because: err.code == 1 ? '用户拒绝' : err.code == 2 ? '定位失败' : '定位超时',
            message: err.message
        })
    }
    stopRecord(){
        navigator.geolocation.clearWatch(this.id)
    }
    getRecord(){
        return JSON.stringify(this.records)
    }
    clearRecord(){
        this.records = []
    }
}

