class Widget extends VisibleWidget {
	constructor(props) {
		super(props);

		this.ref = undefined;
		this.videoSrc = props.videoSrc;
		this.autoplay = props.autoplay;
		this.controls = props.controls;
		this.loop = props.loop;
		this.muted = props.muted;
		this.poster = props.poster;
		this.track = props.track;
		this.trackSrc = props.trackSrc;
		// this.kind = props.kind;
		this.label = props.label;
		this.srclang = props.srclang;

	}

	play = () => { this.ref.play(); }
	pause = () => { this.ref.pause(); }
	setCurrentTime = (value) => { this.ref.currentTime = value; }
	getCurrentTime = () => { return this.ref.currentTime; }
	duration = () => { return this.ref.duration; }
	paused = () => { return this.ref.paused; }
	setPlaybackRate = (value) => { this.ref.playbackRate = value; }
	getPlaybackRate = () => { return this.ref.playbackRate; }
	ended = () => { return this.ref.ended; }

	onEnded = (event) => { this.emit('onEnded'); }
	onPause = (event) => { this.emit('onPause'); }
	onPlay = (event) => { this.emit('onPlay'); }
	onRateChange = (event) => { this.emit('onRateChange'); }
	onVolumeChange = (event) => { this.emit('onVolumeChange'); }
	onError = (event) => { this.emit('onError'); }

	render() {
		return (
			<video
				ref={ref => this.ref = ref}
				src={this.videoSrc}
				autoPlay={this.autoPlay}
				controls={this.controls}
				loop={this.loop}
				muted={this.muted}
				poster={this.poster}
				style={{
					height: '100%',
					width: '100%',
				}}
				onEnded={this.onEnded}
				onPause={this.onPause}
				onPlay={this.onPlay}
				onRateChange={this.onRateChange}
				onVolumeChange={this.onVolumeChange}
				onError={this.onError}
			>
				{
					this.track === true ? <track
						src={this.trackSrc}
						// kind={this.kind}
						label={this.label}
						srclang={this.srclang}
					></track> : <></>
				}
			</video>
		);
	}
}

